   <React.Fragment>
            <footer className="footer">
                <Container fluid={true}>
                    <Row>
                        <Col md={6}>
                            {new Date().getFullYear()} Â© AcadWritings.
                        </Col>
                    </Row>
                </Container>
            </footer>
        </React.Fragment>
